import React from 'react'
import '../../img/Posterbir.png'

const movies = [
    {
        img: '../../img/Posterbir.png',

    },
    {
        img: '../../img/Poster2.png',
    },
    {
        img: '../../img/Poster3.png',
    },
    {
        img: '../../img/Poster4.png',
    },
]

const Movies = () => {
  return (
    <div>
        {
           movies.map((img, i) => (
                <img key={img+i} src={img} />
           ))
        }
    </div>
  )
}

export default Movies
